import React from "react";
// import "./Details.css";
import './css/Details.css';
const Details = () => {
  return (
    <>
      <div className="about-list">
        <span>HOME</span>
        <span>|</span>
        <span>SHOP</span>
      </div>
      <div className="details">
        <div className="detailscontent">
          <div className="heading">DISCOVER OUR PRODUCTS</div>
          <p>
          Discover a wide range of high-quality products crafted to meet your needs. 
          Experience innovation, elegance, and style with our exclusive selection.
          </p>
        </div>
      </div>
    </>
  );
};

export default Details;
